import React from 'react';
import "./Header1.css";
import { Nav,NavLink } from 'reactstrap';

const Header1 = (props) => {
  return (
    <div>
      <Nav>
        <NavLink href="#">Link</NavLink>
        <NavLink href="#">Link</NavLink> 
        <NavLink href="#">Another Link</NavLink> 
        <NavLink href="#">Disabled Link</NavLink>
      </Nav>
    </div>
  );
}

export default Header1;
